ze: 14px; line-height: 18.7600002288818px;\" \/><span style=\"color: #141823; font-family: helvetica, arial, 'lucida grande', sans-serif; font-size: 14px; line-height: 18.7600002288818px;\">Board the Royal Caribbean Cruise Lines Enchantment of the Seas and cruise with your fellow nobles as we leave from Port Canaveral and cruise to Nassau, Bahamas then to a private island and return to Port Canaveral. We will have transportation that leaves from Bahia at a nominal fee.<\/span><br style=\"color: #141823; font-family: helvetica, arial, 'lucida grande', sans-serif; font-size: 14px; line-height: 18.7600002288818px;\" \/><br style=\"color: #141823; font-family: helvetica, arial, 'lucida grande', sans-serif; font-size: 14px; line-height: 18.7600002288818px;\" \/><span style=\"color: #141823; font-family: helvetica, arial, 'lucida grande', sans-serif; font-size: 14px; line-height: 18.7600002288818px;\">Inside Cabins start at $333 pp.<\/span><br style=\"color: #141823; font-family: helvetica, arial, 'lucida grande', sans-serif; font-size: 14px; line-height: 18.7600002288818px;\" \/><span style=\"color: #141823; font-family: helvetica, arial, 'lucida grande', sans-serif; font-size: 14px; line-height: 18.7600002288818px;\">Contact Mitch Lokken for Shrine Pricing.\u00a0<\/span><br style=\"color: #141823; font-family: helvetica, arial, 'lucida grande', sans-serif; font-size: 14px; line-height: 18.7600002288818px;\" \/><span style=\"color: #141823; font-family: helvetica, arial, 'lucida grande', sans-serif; font-size: 14px; line-height: 18.7600002288818px;\">Phone: 407-592-7113<\/span><br style=\"color: #141823; font-family: helvetica, arial, 'lucida grande', sans-serif; font-size: 14px; line-height: 18.7600002288818px;\" \/><span style=\"color: #141823; font-family: helvetica, arial, 'lucida grande', sans-serif; font-size: 14px; line-height: 18.7600002288818px;\">Email: <a href=\"mailto:mitchlokken@yahoo.com\">mitchlokken@yahoo.com<\/a><\/span><br style=\"color: #141823; font-family: helvetica, arial, 'lucida grande', sans-serif; font-size: 14px; line-height: 18.7600002288818px;\" \/><br style=\"color: #141823; font-family: helvetica, arial, 'lucida grande', sans-serif; font-size: 14px; line-height: 18.7600002288818px;\" \/><span style=\"color: #141823; font-family: helvetica, arial, 'lucida grande', sans-serif; font-size: 14px; line-height: 18.7600002288818px;\">Day 1<\/span><br style=\"color: #141823; font-family: helvetica, arial, 'lucida grande', sans-serif; font-size: 14px; line-height: 18.7600002288818px;\" \/><span style=\"color: #141823; font-family: helvetica, arial, 'lucida grande', sans-serif; font-size: 14px; line-height: 18.7600002288818px;\">Departs 4:00 PM Welcome: Orlando (Port Canaveral), Florida<\/span><br style=\"color: #141823; font-family: helvetica, arial, 'lucida grande', sans-serif; font-size: 14px; line-height: 18.7600002288818px;\" \/><span style=\"color: #141823; font-family: helvetica, arial, 'lucida grande', sans-serif; font-size: 14px; line-height: 18.7600002288818px;\">Welcome aboard Enchantment of the Seas<\/span><span class=\"text_exposed_show\" style=\"display: inline; color: #141823; font-family: helvetica, arial, 'lucida grande', sans-serif; font-size: 14px; line-height: 18.7600002288818px;\"><br \/>Port Canaveral is your gateway to the Space Coast and the attractions of Central Florida. Visit the Kennedy Space Center, swim at Cocoa Beach or enjoy a fun-filled day at one of Orlando's world-famous theme parks.<\/span><\/p>\r\n<p>Day 2<br \/>Arrives 12:00 PM Departs 11:59 PM (Docked) Port of Call: Nassau, Bahamas<br \/>With dazzling beaches, turquoise waters, colorful past and vibrant Junkanoo culture, Nassau is a great place to sun and sightsee. The city is on New Providence Island; just offshore is Paradise Island, home to luxury hotels and resorts.<\/p>\r\n<p>Day 3<br \/>Arrives 8:00 AM Departs 5:00 PM (Tendered) Port of Call: CocoCay, Bahamas<br \/>Our private island is a Bahamian paradise. CocoCay\u00ae\u2014 features all kinds of activities -- snorkeling, kayaking, boating, jet-ski rentals, an aqua park and more -- plus nature walks, beaches and plenty of spots to relax and recharge.<\/p>\r\n<p>Day 4<br \/>Arrives 7:00 AM Port of Arrival: Orlando (Port Canaveral), Florida<br \/>Port Canaveral is your gateway to the Space Coast and the attractions of Central Florida. Visit the Kennedy Space Center, swim at Cocoa Beach or enjoy a fun-filled day at one of Orlando's world-famous theme parks.<\/p>","geolon":"0","geolat":"0","location":"","priority":"0","status":"","summary":"Potentate's Cruise","contact":"Mitch Lokken - mitchlokken@yahoo.com - 407-592-7113","organizer":"","url":"","extra_info":"","created":"","sequence":"0","state":"1","modified":"2015-05-27 10:02:12","multiday":"1","hits":"71","noendtime":"0"},{"evdet_id":"127","rawdata":"","dtstart":"1433077200","dtstartraw":"","duration":"0","durationraw":"","dtend":"1433131199","dtendraw":"","dtstamp":"","class":"","categories":"","color":"","description":"<p><img src=\"images\/banners\/fp\/slideshow_dreamflight.png\" alt=\"slideshow dreamflight\" \/><\/p>\r\n<p><span style=\"color: #141823; font-family: helvetica, arial, 'lucida grande', sans-serif; font-size: 14px; line-height: 18.7600002288818px;\">Dreamflight is a registered UK charity that changes young lives through taking seriously ill and disabled children, without their parents, on the holiday of a lifetime to Orlando, Florida.<\/span><br style=\"color: #141823; font-family: helvetica, arial, 'lucida grande', sans-serif; font-size: 14px; line-height: 18.7600002288818px;\" \/><br style=\"color: #141823; font-family: helvetica, arial, 'lucida grande', sans-serif; font-size: 14px; line-height: 18.7600002288818px;\" \/><span style=\"color: #141823; font-family: helvetica, arial, 'lucida grande', sans-serif; font-size: 14px; line-height: 18.7600002288818px;\">Once a year, 192 deserving children from all over the UK, accompanied by a team of medical carers, 