:"","organizer":"","url":"","extra_info":"","created":"","sequence":"0","state":"1","modified":"2015-07-02 10:35:30","multiday":"1","hits":"91","noendtime":"0"},{"evdet_id":"136","rawdata":"","dtstart":"1437694200","dtstartraw":"","duration":"0","durationraw":"","dtend":"1437710399","dtendraw":"","dtstamp":"","class":"","categories":"","color":"","description":"<p><span style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\">Nobles,<\/span><br style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\" \/><br style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\" \/><span style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\">I have called a special meeting to be held here at Bahia Shrine\u00a0on<\/span><span class=\"aBn\" style=\"border-bottom-width: 1px; border-bottom-style: dashed; border-bottom-color: #cccccc; position: relative; top: -2px; z-index: 0; color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\" data-term=\"goog_1970939833\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">July 23 at 7:30 p.m.<\/span><\/span><span style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\">\u00a0In the meeting we will be discussing the\u00a0issues facing Bahia Shrine including the possible sale of the\u00a0building. We are looking into every available scenario\u00a0<\/span><em style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\"><strong>but we are\u00a0NOT terminating the fraternity.<\/strong><\/em><br style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\" \/><br style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\" \/><span style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\">This must be voted on by the Nobility per the Articles of Incorporation\/Bylaws:<\/span><br style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\" \/><br style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\" \/><em style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\">\u00a7334.9 Sale of Temple Assets. Any temple, or any of its affiliates, contemplating\u00a0the sale, lease, exchange, mortgage, pledge or other disposition of all or substantially all\u00a0of its property and assets, may only do so upon such terms and conditions and for such\u00a0consideration as shall be first authorized by a vote of the temple at a Stated or special\u00a0meeting which sets forth in the notice of the meeting the specific nature of the business\u00a0to be transacted. The notice of the meeting must be sent to every member of the temple\u00a0at least 20 days prior to the meeting<\/em><br style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\" \/><br style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\" \/><span style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\">I will also report on the proceedings from Imperial Session that will\u00a0be held in Houston over the 4th of July weekend. Your presence at\u00a0this meeting will be greatly appreciated.<\/span><\/p>\r\n<p><span style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\">There will be a dinner before the special Stated meeting<\/span><span style=\"color: #222222; font-family: arial, sans-serif; line-height: normal; text-align: justify;\">. Spaghetti, salad, bread, tea and water. Price I think is around $5. Please try to attend if you can.<\/span><br style=\"