 questions.<\/span><\/p>\r\n<p style=\"margin-top: 5px; margin-bottom: 5px; color: #4d4d4d; text-align: center;\"><span style=\"font-size: 18pt; font-family: 'Bodoni BT', serif;\">We look forward to seeing you all there!<\/span><\/p>\r\n<p style=\"margin-top: 5px; color: #4d4d4d; text-align: center;\"><span style=\"font-size: 18pt; font-family: 'Bodoni BT', serif;\">2017 \/ 2018 Executive Committee<\/span><\/p>","geolon":"0","geolat":"0","location":"Bahia","priority":"0","status":"","summary":"Imperial 2017 Fun Night","contact":"","organizer":"","url":"","extra_info":"","created":"","sequence":"0","state":"1","modified":"2015-09-15 11:47:28","multiday":"1","hits":"30","noendtime":"1"},{"evdet_id":"183","rawdata":"","dtstart":"1457240400","dtstartraw":"","duration":"0","durationraw":"","dtend":"1457326799","dtendraw":"","dtstamp":"","class":"","categories":"","color":"","description":"<p><a href=\"http:\/\/www.samswopecharityride.org\">http:\/\/www.samswopecharityride.org<\/a><\/p>","geolon":"0","geolat":"0","location":"Bahia Shrine Temple","priority":"0","status":"","summary":"Sam Swope Memorial Charity Ride","contact":"","organizer":"","url":"","extra_info":"http:\/\/www.samswopecharityride.org","created":"","sequence":"0","state":"1","modified":"2015-09-28 12:46:03","multiday":"1","hits":"81","noendtime":"0"},{"evdet_id":"184","rawdata":"","dtstart":"1444492800","dtstartraw":"","duration":"0","durationraw":"","dtend":"1444500000","dtendraw":"","dtstamp":"","class":"","categories":"","color":"","description":"<p><span style=\"color: #454545; font-size: 13.3333330154419px; line-height: 16px;\">Join us in the Red Fez Lounge most Saturdays as we cook up some delicious burgers and brats! Everyone is welcome! Bring the family for an affordable lunch and enjoy some fellowship while you're there. Only $2 for a burger or brat!&nbsp;<\/span><\/p>\r\n<p><img src=\"images\/red_fez\/brats.png\" alt=\"brats\" width=\"182\" height=\"166\" style=\"float: right;\" \/><\/p>","geolo