":"","dtstamp":"","class":"","categories":"","color":"","description":"<p>No Dinner!<\/p>","geolon":"0","geolat":"0","location":"","priority":"0","status":"","summary":"Special Called Meeting","contact":"","organizer":"","url":"","extra_info":"","created":"","sequence":"0","state":"1","modified":"2015-10-20 11:42:41","multiday":"1","hits":"35","noendtime":"1"},{"evdet_id":"214","rawdata":"","dtstart":"1450398600","dtstartraw":"","duration":"0","durationraw":"","dtend":"1450414799","dtendraw":"","dtstamp":"","class":"","categories":"","color":"","description":"<p>No Dinner!<\/p>","geolon":"0","geolat":"0","location":"","priority":"0","status":"","summary":"Special Called Meeting","contact":"","organizer":"","url":"","extra_info":"","created":"","sequence":"0","state":"1","modified":"2015-10-20 11:43:12","multiday":"1","hits":"38","noendtime":"1"},{"evdet_id":"215","rawdata":"","dtstart":"1450026000","dtstartraw":"","duration":"0","durationraw":"","dtend":"1450069199","dtendraw":"","dtstamp":"","class":"","categories":"","color":"","description":"<p><span style=\"color: #222222; font-family: arial, sans-serif; font-size: 12.8px; line-height: normal;\">step off at 12:00<\/span><\/p>\r\n<p>City of DeBary Parks and Recreation Department<\/p>\r\n<p>Christmas Parade 2015<\/p>\r\n<p>Please review these important items with members of your group, including walkers. The following information will<\/p>\r\n<p>assist your group while participating in the City of DeBary Christmas Parade. The theme is &ldquo;Inside Santa&rsquo;s Workshop&rdquo;<\/p>\r\n<p>st, 2nd and 3rd place will be awarded in each category based on theme, originality, and overall appearance.<\/p>\r\n<p>1. PLEASE HAVE YOUR ENTIRE GROUP AT THE LINE UP ON SPRING VISTA DR. NO LATER THAN 2:00PM! We will begin the<\/p>\r\n<p>line up at 1:00PM. PASS THIS INFORMATION ON TO ALL OF YOUR PARTICIPANTS!<\/p>\r\n<p>2. Please indicate ACCURATE dimensions for all aspects of your entry; this will allow staff to allocate enough space for all<\/p>\r\n<p>vehicles, floats and walkers.<\/p>\r\n<p>3. All walkers, drop off or otherwise, are asked to car pool and use the Spring Vista Commerce Center as their drop off<\/p>\r\n<p>location. Please utilize 17-92 to Glen Forest Drive to Englenook Road to access this location.<\/p>\r\n<p>4. All parade participants that have kids in the parade MUST have a roster on hand in case of emergency.<\/p>\r\n<p>5. The minimum age for kids to walk the parade is 10 years old. Anyone younger than 10 must be on the float. Please do<\/p>\r\n<p>not leave until all the children in your group have been picked up.<\/p>\r\n<p>6. PARADE VEHICLES will only be permitted to enter Spring Vista Drive via S. Shell Road.<\/p>\r\n<p>7. Please note 17-92 will close at 2:00pm, however the entry to Spring Vista Road via 17-92 will be closed as early as 12:00pm.<\/p>\r\n<p>8. It is important for all parade entries to indicate their parade number to the judge&rsquo;s stand at the end of the parade for<\/p>\r\n<p>judging purposes. Group representatives will be contacted with their parade line-up number by<\/p>\r\n<p>Tuesday, December 8, 2015<\/p>\r\n<p>9. Please DO NOT THROW candy. Handing out candy is OK.<\/p>\r\n<p>10. To prevent gaps in the parade we ask that all parade entries be NO MORE than 10 feet behind the<\/p>\r\n<p>entry in front of them.<\/p>\r\n<p>11. Please keep any performances for the judges to less than a minute for time purposes.<\/p>\r\n<p>12. Walkers can be picked up at the Winn Dixie parking lot at the conclusion of the parade. Walkers can use Legion Place Drive<\/p>\r\n<p>to safely cross Highbanks Road to the Winn Dixie parking lot.<\/p>\r\n<p>13. Winners will be contacted the following week by staff; members of the winning groups will be asked to attend the City<\/p>\r\n<p>Council meeting scheduled for December 16, 2015 to receive their trophy.<\/p>\r\n<p>14. All parade vehicles must line-up in the area designated by staff; please be sure to have two wheels on the