ion":"","geolon":"0","geolat":"0","location":"mokanna","priority":"0","status":"","summary":"BAHIA SPECIAL CALLED MEETING","contact":"","organizer":"","url":"","extra_info":"","created":"","sequence":"0","state":"1","modified":"2016-08-15 23:09:47","multiday":"1","hits":"13","noendtime":"1"},{"evdet_id":"333","rawdata":"","dtstart":"1474106400","dtstartraw":"","duration":"0","durationraw":"","dtend":"1474171199","dtendraw":"","dtstamp":"","class":"","categories":"","color":"","description":"<p><img src=\"images\/potentate_events\/822924_invite-finial.png\" alt=\"822924 invite finial\" \/><\/p>","geolon":"0","geolat":"0","location":"620 Hickman Cir., Sanford, FL","priority":"0","status":"","summary":"Bahia Potentate's Ball","contact":"","organizer":"","url":"","extra_info":"","created":"","sequence":"0","state":"1","modified":"2016-08-26 10:18:31","multiday":"1","hits":"1","noendtime":"1"},{"evdet_id":"334","rawdata":"","dtstart":"1474718400","dtstartraw":"","duration":"0","durationraw":"","dtend":"1474725600","dtendraw":"","dtstamp":"","class":"","categories":"","color":"","description":"<h2 style=\"line-height: normal; text-align: justify; font-size: 14px; font-weight: bold; font-style: italic; text-transform: uppercase; padding: 0px; font-family: 'Times New Roman', Times, serif;\"><span style=\"font-size: 22px;\">FLAPJACK FUNDRAISER (PANCAKE BREAKFAST)<\/span><\/h2>\r\n<div style=\"color: #7b7769; font-size: 11px; line-height: normal; text-align: justify;\"><span style=\"font-size: 14px;\"><strong><span class=\"aBn\" style=\"border-bottom: 1px dashed #cccccc; position: relative; top: -2px; z-index: 0;\" tabindex=\"0\" data-term=\"goog_1672808299\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">Saturday, September 24 2016<\/span><\/span><\/strong><\/span><br \/><span style=\"font-size: 14px;\"><strong>2823 S. Orange Ave,\u00a0Orlando,\u00a0FL<\/strong><\/span><br \/><img src=\"https:\/\/ci6.googleusercontent.com\/proxy\/NcdpF0RYL7JUJGNSIyisXQ_Xeu-fN87-HSTRfwNbIUMWrHVnK0WfbFoc8bc_c5os7ikcKiQXsS54WHdZjn7D49Mi8reSD6jDVPf17uF3B9oSfClnmBkkPv8CBRQNiSQ=s0-d-e1-ft#http:\/\/www.bahiashrine.org\/media\/com_acymailing\/upload\/round_flapjack.jpg\" alt=\"\" width=\"156\" height=\"143\" class=\"CToWUd\" style=\"min-height: 143px; font-size: 14px; width: 156px; float: right; margin: 10px;\" hspace=\"10\" \/><br \/><span style=\"font-size: 14px;\"><span style=\"font-size: 14px;\">Nobles, We are trying a new twist on the pancake breakfast. We are partnering with Applebee's for a Flapjack Fundraiser!\u00a0We (Nobles) sell tickets for $5 to friends, neighbors, each other, etc. to attend\u00a0Applebee's pancake breakfast. What a great way to enjoy breakfast, fun and fellowship just like we have at our pancake breakfasts in the past.<\/span><\/span>\r\n<p>Why partner with Applebee's?\u00a0We get $3 and Applebee's gets $2 cash per ticket sold. It's a win \/ win for everyone.<\/p>\r\n<p>ONLY MAJOR DIFFERENCE is that ALL\u00a0tickets must be printed and sold prior to the day of.\u00a0We need to turn in a count of all tickets on\u00a0<span class=\"aBn\" style=\"border-bottom: 1px dashed #cccccc; position: relative; top: -2px; z-index: 0;\" tabindex=\"0\" data-term=\"goog_1672808300\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">Wednesday 9\/21\/2016<\/span><\/span>.\u00a0 That gives us 2 meetings to sell as many tickets as we can.<\/p>\r\n<p>Also, we, Bahia, are\u00a0responsible for the volunteer service\u00a0staff including greeters, seaters, servers and bussers. While this part WAS typically handled by the Divan, ANYONE is welcome to help out.\u00a0<\/p>\r\n<p>Tickets will be available in the Bahia Office during regular office hours.<\/p>\r\n<p>Are you ready to sell some breakfast tickets and bus some tables????<br \/>LETS PROMOTE, SELL AND EAT PANCAKES.<\/p>\r\n<\/div>","geolon":"0","geolat":"0","location":"Applebee's. 2823 S. Orange Ave, Orlando, FL","priority":"0","status":"","summary":"Flapjack Fundraiser","contact":"","organizer":"","url":"","extra_info":"","created":"","sequence":"0","state":"1","modified":"2016-08-26 10:21:05","multiday":"1","hits":"0","noendtime":"0"},{"evdet_id":"335","rawdata":"","dtstart":"1474930800","dtstartraw":"","duration":"0","durationraw":"","dtend":"1474948799","dtendraw":"","dtstamp":"","class":"","categories":"","color":"","description":"<h2 style=\"line-height: normal; text-align: justify; font-size: 14px; font-weight: bold; font-style: italic; text-transform: uppercase; padding: 0px; font-family: 'Times New Roman', Times, serif;\"><span style=\"font-size: 22px;\">CHILDREN'S CHRISTMAS PARTY MEETING<\/span><\/h2>\r\n<div style=\"color: #7b7769; font-size: 11px; line-height: normal; text-align: justify;\"><span style=\"font-size: 14px;\"><strong><span class=\"aBn\" style=\"border-bottom: 1px dashed #cccccc; position: relative; top: -2px; z-index: 0;\" tabindex=\"0\" data-term=\"goog_1672808301\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">Monday, September 29, 2016<\/span><\/span><\/strong><\/span>\r\n<p><img src=\"https:\/\/ci6.googleusercontent.com\/proxy\/Dk_0IL2Sl2lH-BngyZCBGiYtvmR4njtz-ex0uA2-62jsC_rNgjQnrkVEyFa2B7TWxSyZ1YyS0ywf_ga8FEHzYp9-SihCmMD7ohz2Z8X4ZMgmmsu8hTGznozB0LnozyRofkG0U3LE8g3OUMZBPw=s0-d-e1-ft#http:\/\/www.bahiashrine.org\/media\/com_acymailing\/upload\/teddy_bear_in_present_md_clr.gif\" alt=\"\" width=\"130\" height=\"100\" class=\"CToWUd\" style=\"min-height: 100px; width: 130px; float: right; margin: 10px;\" hspace=\"10\" \/><span style=\"font-size: 14px;\">On\u00a0<span class=\"aBn\" style=\"border-bottom: 1px dashed #cccccc; position: relative; top: -2px; z-index: 0;\" tabindex=\"0\" data-term=\"goog_1672808302\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">Monday, September 29, 2016<\/span><\/span>, in the back room of the temporary Bahia Office, located at 2300 Pembrook Drive, Orlando, there will be another meeting of the Bahia Patient Christmas Party Committee. The Meeting will start at\u00a0<span class=\"aBn\" style=\"border-bottom: 1px dashed #cccccc; position: relative; top: -2px; z-index: 0;\" tabindex=\"0\" data-term=\"goog_1672808303\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">7:00pm<\/span><\/span>.<\/span><\/p>\r\n<p><span style=\"font-size: 14px;\">All members and those who wish to join the team to assure that our Bahia Patients who are being treated at several of our Shriners Hospitals for Children have a successful and\u00a0meaningful\u00a0Christmas Party are encouraged to attend.<\/span><\/p>\r\n<p><span style=\"font-size: 14px;\">This year&rsquo;s party will be held at the Sanford Civic Center, on\u00a0<span class=\"aBn\" style=\"border-bottom: 1px dashed #cccccc; position: relative; top: -2px; z-index: 0;\" tabindex=\"0\" data-term=\"goog_1672808304\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">Sunday, December 11th<\/span><\/span>, between the hours of<span class=\"aBn\" style=\"border-bottom: 1px dashed #cccccc; position: relative; top: -2px; z-index: 0;\" tabindex=\"0\" data-term=\"goog_1672808305\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">1pm through 4 pm<\/span><\/span>.<\/span><\/p>\r\n<p><span style=\"font-size: 14px;\">People are needed to set up and clean up, decorate the hall, shop for gifts, wrap gifts, greet the families, cook and serve food, and distribute presents.<\/span><\/p>\r\n<p><span style=\"font-size: 14px;\">There is a job for everyone.<\/span><\/p>\r\n<p><span style=\"font-size: 14px;\">Please make an effort to attend.<\/span><\/p>\r\n<p><span style=\"font-size: 14px;\">For more information all me at\u00a0<a href=\"tel:%28407%29%20339-4075\" target=\"_blank\" style=\"color: #1155cc;\">(407) 339-4075<\/a><\/span><br \/><span style=\"font-size: 14px;\">David Roy<\/span><br \/><span style=\"font-size: 14px;\">Christmas Party Chairma<\/span><\/p>\r\n<\/div>","geolon":"0","geolat":"0","location":"Bahia Shrine Office","priority":"0","status":"","summary":"Children's Christmas Party Meeting","contact":"","organizer":"","url":"","extra_info":"","created":"","sequence":"0","state":"1","modified":"2016-08-26 10:23:50","multiday":"1","hits":"0","noendtime":"1"},{"evdet_id":"336","rawdata":"","dtstart":"1475208000","dtstartraw":"","duration":"0","durationraw":"","dtend":"1475380799","dtendraw":"","dtstamp":"","class":"","categories":"","color":"","description":"<h2 style=\"line-height: normal; text-align: justify; font-size: 14px; font-weight: bold; font-style: italic; text-transform: uppercase; padding: 0px; font-family: 'Times New Roman', Times, serif;\"><span style=\"font-size: 22px;\">ANNUAL PAPER CRUSADE<\/span><\/h2>\r\n<div style=\"color: #7b7769; font-size: 11px; line-height: normal; text-align: justify;\"><span style=\"font-size: 14px;\"><strong><span class=\"aBn\" style=\"border-bottom: 1px dashed #cccccc; position: relative; top: -2px; z-index: 0;\" tabindex=\"0\" data-term=\"goog_1672808306\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">Saturday, September 30-October 1, 2016<\/span><\/span><\/strong><\/span>\r\n<p><span style=\"font-size: 14px;\">Nobles,<\/span><\/p>\r\n<p>We all became Shriners to help kids with their Orthopedic and burn needs. As Shriners we have taken an oath and given our commitment to those kids currently in our system, as well as the future kids that will need our help, that we will do all we can to provide them with the best service available.<\/p>\r\n<p>Our hospitals have been pioneers and visionaries in the treatment of our kids for many years. Their vision and commitment to excellence has made &ldquo;Shriners&rdquo; a household name and given us recognition in our community as well as all over the world. There are men worldwide that became Shriners because they wanted to give back to the organization that helped them when they were in need. There are Shriners at Bahia that were Shrine kids. We need to keep the smiles on all of our kids&rsquo; faces.<\/p>\r\n<p>I am sending this out to you as a call to action. This coming\u00a0<span class=\"aBn\" style=\"border-bottom: 1px dashed #cccccc; position: relative; top: -2px; z-index: 0;\" tabindex=\"0\" data-term=\"goog_1672808307\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">September 30 and October 1st<\/span><\/span>\u00a0we will be participating in our annual Paper Crusade. Although we should raise money all year long for our hospitals and our transportation fund, this is the time of year where we all come together as a group and inform the public of what we do. It is a very rewarding time as a Shriner when someone comes up and tells you how the Shrine changed their life. Although our goal is to raise money for our hospitals, the most important part of that day is to inform people of what we do. You may hand a young mother what appears to be a newspaper about what we do, but in reality you handed her the answer to her prayers for her young child. That small transaction in turn changes her future. I know that we have all met someone in our travels that is so thankful for the service that our hospitals provided for them. We need to keep that long tradition going. We ALL need to get out on those two days, wear our Fez proudly, inform the public, and raise money for our kids.<\/p>\r\n<p>Let us get out on those two days and bring shock and awe to Central Florida. This is the day when EVERY Shriner needs to be out in the public eye.<\/p>\r\n<p>I know that there are some of you that are limited and can&rsquo;t get around as well as you used to. There are others that can still boogie. We have places for BOTH.<\/p>\r\n<p>This is the time to get all the Units and Clubs working together to make this a success. Let us display unity and strength by having Fezzes all over town. If you belong to a smaller Unit or Club, join forces with another smaller group or one of the other bigger Units. The Directors Staff would gladly welcome any other Unit or Club to participate with us. Please contact our President Frank Kroll or myself and we can make that happen. The more of us there, the better we look... The more of us there, the more chances of collecting&hellip; The more of us there, the more kids we can keep smiling&hellip; All the money goes to the same place. There is no reason we can&rsquo;t join forces.<\/p>\r\n<p>Please start making plans to participate. This is why you became a SHRINER.<br \/>\u00a0<br \/>Yours in the Faith,<br \/>\u00a0<br \/>Eddie Perez<br \/>Director<\/p>\r\n<\/div>","geolon":"0","geolat":"0","location":"","priority":"0","status":"","summary":"Paper Crusade","contact":"","organizer":"","url":"","extra_info":"","created":"","sequence":"0","state":"1","modified":"2016-08-26 10:25:06","multiday":"1","hits":"1","noendtime":"0"},{"evdet_id":"337","rawdata":"","dtstart":"1472590800","dtstartraw":"","duration":"0","durationraw":"","dtend":"1472615999","dtendraw":"","dtstamp":"","class":"","categories":"","color":"","description":"<h2 style=\"line-height: normal; font-size: 14px; font-weight: bold; text-transform: uppercase; text-align: right; margin-top: 2px; margin-bottom: 2px; padding: 0px;\">JOHNNY'S FILLIN' STATION<\/h2>\r\n<div style=\"color: #7b7769; line-height: normal; text-align: right;\"><strong><span class=\"aBn\" style=\"border-bottom: 1px dashed #cccccc; position: relative; top: -2px; z-index: 0;\" tabindex=\"0\" data-term=\"goog_1672808313\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">Tuesday,\u00a0August 30, 2016<\/span><\/span><br \/><span class=\"aBn\" style=\"border-bottom: 1px dashed #cccccc; position: relative; top: -2px; z-index: 0;\" tabindex=\"0\" data-term=\"goog_1672808314\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">5:00 pm<\/span><\/span>\u00a0till ??<\/strong><\/div>\r\n<p><img src=\"https:\/\/ci3.googleusercontent.com\/proxy\/Y8aNaMjf-