p-content\/uploads\/2015\/02\/fclogo-e1425118492408.png\" alt=\"\" width=\"150\" height=\"128\" class=\"CToWUd\" style=\"border-width: 0px; border-style: initial; min-height: 128px; width: 150px; float: left; margin: 5px;\" hspace=\"5\" \/><\/a><span style=\"color: #7b7769; line-height: normal; text-align: justify;\">Join us\u00a0<\/span><span class=\"aBn\" style=\"border-bottom: 1px dashed #cccccc; position: relative; top: -2px; z-index: 0; color: #7b7769; line-height: normal; text-align: justify;\" tabindex=\"0\" data-term=\"goog_1672808318\"><span class=\"aQJ\" style=\"position: relative; top: 2px; z-index: -1;\">Wednesday, September 9th<\/span><\/span><span style=\"color: #7b7769; line-height: normal; text-align: justify;\">\u00a0as the\u00a0<\/span><span class=\"il\" style=\"color: #7b7769; line-height: normal; text-align: justify;\">Roaming<\/span><span style=\"color: #7b7769; line-height: normal; text-align: justify;\"><\/span><span class=\"il\" style=\"color: #7b7769; line-height: normal; text-align: justify;\">Red<\/span><span style=\"color: #7b7769; line-height: normal; text-align: justify;\">\u00a0Fez visits Friendly Confines IV on Orange Ave.<\/span><br style=\"color: #7b7769; line-height: normal; text-align: justify;\" \/><br style=\"color: #7b7769; line-height: normal; text-align: justify;\" \/><span style=\"color: #7b7769; line-height: normal; text-align: justify;\">The first Friendly Confines Restaurant was opened by Carmen and Christine Jordan in the east Orlando suburb of Waterford Lakes in 2000. Confines popularity was immediate and over the next few years was known as the place to go for good sports, good food at a great price.<\/span><br style=\"color: #7b7769; line-height: normal; text-align: justify;\" \/><br style=\"color: #7b7769; line-height: normal; text-align: justify;\" \/><span style=\"color: #7b7769; line-height: normal; text-align: justify;\">Keeping those ideals in mind Carmen & Christine opened up 3 more locations throughout the Central Florida area over the next 15 years. As we continue to grow and expand we will maintain our proud tradition of being locally owned and operated for more than 15 years.<\/span><br style=\"color: #7b7769; line-height: normal; text-align: justify;\" \/><br style=\"color: #7b7769; line-height: normal; text-align: justify;\" \/><span style=\"color: #7b7769; line-height: normal; text-align: justify;\">Today when you walk through the doors of a Friendly Confines, You will find walls of autographed sports jerseys with some of your favorite hall of famers from every sport. We are a Chicago themed sports restaurant but we love all of our teams. Whether from the windy city, out west or from right here in our backyard. We will always be happy to find your game for you.<\/span><br style=\"color: #7b7769; line-height: normal; text-align: justify;\" \/><br style=\"color: #7b7769; line-height: normal; text-align: justify;\" \/><strong style=\"color: #7b7769; line-height: normal; text-align: justify;\">Event Location:<\/strong><span style=\"color: #7b7769; line-height: normal; text-align: justify;\">\u00a04757 S Orange Ave, Orlando, FL 32806\u00a0[<\/span><a href=\"index.php?subid=14&option=com_acymailing&ctrl=url&urlid=2905&mailid=606&Itemid=2161\" target=\"_blank\" style=\"color: #979129; line-height: normal; text-align: justify; font-weight: bold; font-style: italic; border: none;\" data-saferedirecturl=\"https:\/\/www.google.com\/url?hl=en&q=http:\/\/www.bahiashrine.org\/index.php?subid%3D14%26option%3Dcom_acymailing%26ctrl%3Durl%26urlid%3D2905%26mailid%3D606%26Itemid%3D2161&source=gmail&ust=1472308189289000&usg=AFQjCNG4Rhp8kfg6R2gVswhreu1q-_UH-w\">map<\/a><span style=\"color: #7b7769; line-height: normal; text-align: justify;\">]<\/span><br style=\"color: #7b7769; line-height: normal; text-align: justify;\" \/><br style=\"color: #7b7769; line-height: normal; text-align: justify;\" \/><span style=\"color: #7b7769; line-height: normal; text-align: justify;\">For more info on